import React from "react";
import '../App.css'
import { Link } from "react-router-dom";


function Nav(){
    const navStyle = {
        color: 'white'
    };

    return(
      <nav>
        <h1>Home Page</h1>
        <ul className="nav-links">
            <Link style={navStyle} to="/home">
            <li>Home</li>
            </Link>
            <Link to="/about">
                <li>About</li>
            </Link>
            <Link to="/projects">
                <li>Projects</li>
            </Link>
            <Link to="/contactme">
                <li>Contact Info</li>
            </Link>
                  
        </ul>
      </nav>
    )
}



export default Nav;
